INSERT INTO `berita` (`id`, `judul`, `isi`, `gambar`, `kategori_id`, `tanggal_publikasi`) VALUES
(31, '\n        GAMKI: Putusan MK soal Capres/Cawapres U-40 Berpengalaman Penuhi Rasa Keadilan    ', 'Jakarta - Gerakan Angkatan Muda Kristen Indonesia (GAMKI) berpendapat keputusan Mahkamah Konstitusi soal capres dan cawapres di bawah usia 40 tahun boleh maju asalkan berpengalaman sebagai kepala daerah, telah memenuhi aspek keadilan. GAMKI menuturkan putusan MK sejalan dengan perkembangan kepemimpinan di Tanah ir, di mana banyak lahir pemimpin-pemimpin muda.\n\"Keputusan yang dilakukan oleh Mahkamah Konstitusi sudah memenuhi aspek keadilan. MK tidak mengubah batasan usia, karena tidak ada landasan yang tepat untuk mengubah batasan usia dari 40 tahun menjadi batasan usia lainnya. Namun, untuk memenuhi asas keadilan, MK membuka ruang kesempatan bagi warga negara berusia di bawah 40 tahun yang berpengalaman dan pernah terpilih melalui pemilihan umum dan pemilihan kepala daerah untuk menjadi capres ataupun cawapres,\" ujar Ketua Umum Dewan Pimpinan Pusat (DPP) GAMKI Sahat Martin Philip Sinurat, kepada wartawan, Jumat (20/10/2023).\n\nSahat menuturkan saat ini sudah banyak anak-anak muda duduk di kursi eksekutif maupun legislatif. Dia memprediksi usai Pemilu 2024 akan lebih banyak lagi anak muda yang terjun ke politik.\n\nBaca artikel detiknews, \"GAMKI: Putusan MK soal Capres/Cawapres U-40 Berpengalaman Penuhi Rasa Keadilan\" selengkapnya  https://news.detik.com/pemilu/d-6993876/gamki-putusan-mk-soal-caprescawapres-u-40-berpengalaman-penuhi-rasa-keadilan .\n\nDownload Apps Detikcom Sekarang https://apps.detik.com/detik/\n', '1.jpg', 1, '2023-10-20'),
